import React from "react";
import "./Product.css";

function Product() {
  return (
    <section id="Product">
      <div className="container-fluid padding">
        <div className="row text-center padding">
          <div className="col-xs-12 col-sm-6 col-md-4">
            <i className="fas fa-code"></i>
            <h3>Laptop</h3>
          </div>
        </div>
      </div>
    </section>
  );
}

export default Product;
